const KakaoLogin = () => {
  return (
    <>
    <div>
      <img src='/images/logo/kakao완성형3.png'
        alt="카카오 로그인"
        style={{ width: '70%', height: 'auto' }}
        
      >

      </img>
      </div>
    </>
  )
}

export default KakaoLogin
